const user1 = {
    name: 'Junior Prueba',
    username: 'chunior',
    country: 'Jamaica',
    social: {
        facebook: 'https://fb...',
        twitter: 'https://tw...'
    }
}

const saluda = (user) =>{
    console.log(
        `Hola soy ${user.name} y vivo en ${user.country}`
    );
    
}

saluda(user1);
